import React from 'react';
//import logo from './logo.svg';
import './App.css';
import * as Ut from  './Utiles';
interface IState{
  lista:string[];
  sexo:number;
  operacion():void;
}
class App extends React.Component<{},IState>{
  constructor(props:any) {
    super(props)
    this.state={
      lista:[],
      operacion:()=>{},
      sexo:0,
    }
  }
  setOperacion(inp:Ut.Utiles){
    this.setState({operacion:()=>inp.obtenerLista(this.state.sexo)})
  }
  render(){
    var nivel=[1,2,3,4,5]

    return (<div>
      <div>sexo: 
        <button>varon </button>
        <button>mujer</button>
      </div>
      <div>
        nivel
        {nivel.map((element,index) => {
          return(
            <div key={"elemten"}>
              <button>{"nivel"+(index+1)}</button>
            </div>
          )
        })}
      </div>
    </div>)
  }
}
export default App;
